INSERT INTO `yi_seo` VALUES ('5', '积分商城', 'shop', '积分商城_笑豆兑换集市', '积分商城,笔记笑豆,笔记积分兑换', '搞笑笔记笑豆积分商城是为笑友们提供的一项福利，赶紧活跃起来赚笑豆吧，笑豆可以兑换很多精美礼品哦，搞笑笔记,何必如此认真？');
