INSERT INTO `yi_tags` VALUES ('2', '女汉子', 'http://i2.mhimg.com/kl688file/2014-3/2014030316193659288.jpg', '女汉子不会撒娇，性格大大咧咧。女汉子适用于有以下性格特点的女生：天太热时，在家会“裸奔”；吃苹果不削皮，洗了直接啃，薯片吃到最后，直接倒嘴里；女汉子对小清新不感兴趣，与其做那些事情浪费时间，还不如在家抠脚！', '1', '999', '女汉子笑话_女汉子搞笑图片', '女汉子笑话,什么是女汉子,女汉子搞笑图片,搞笑笔记', '女汉子不会撒娇，性格大大咧咧。女汉子适用于有以下性格特点的女生：天太热时，在家会“裸奔”；吃苹果不削皮，洗了直接啃，薯片吃到最后，直接倒嘴里；女汉子对小清新不感兴趣，与其做那些事情浪费时间，还不如在家抠脚！');
INSERT INTO `yi_tags` VALUES ('4', '内涵', '/Uploads/tags/55fbe004d8290.jpg', '指需要仔细琢磨才能明白的文字或图片,常表现为使用隐喻、双关、反讽、暗喻等修辞陈述自己的观点。相信笔记的笑友们一定能够领略那啥那啥的，提示：实在看不懂看评论哦！', '1', '14', '内涵笑话_内涵段子,内涵图', '内涵段子,内涵图,内涵笑话,搞笑笔记', '指需要仔细琢磨才能明白的文字或图片,常表现为使用隐喻、双关、反讽、暗喻等修辞陈述自己的观点。相信笔记的笑友们一定能够领略那啥那啥的，提示：实在看不懂看评论哦！');
INSERT INTO `yi_tags` VALUES ('5', '成人笑话', '/Uploads/tags/5604c0504496a.jpg', '也叫荤段子，指带有一定的色情意味，同时又是民间化的色情与语言智慧的混合物(包括文章、笑话、玩笑);是段子文化兴起的开路先锋。在一定场合能起到心理宣泄、放松情绪、活跃气氛等作用。', '0', '999', '成人笑话_荤段子', '成人笑话,黄段子,荤段子,搞笑笔记', '也叫荤段子，指带有一定的色情意味，同时又是民间化的色情与语言智慧的混合物(包括文章、笑话、玩笑);是段子文化兴起的开路先锋。在一定场合能起到心理宣泄、放松情绪、活跃气氛等作用。');
INSERT INTO `yi_tags` VALUES ('6', '喵星人', '/Uploads/tags/5604c19a34dc7.jpg', '猫咪是从遥远外太空来的，喵星人是来到地球的外星人，因为很萌的外表而获得人类的信任，成为少数与人类平等交往的朋友。他们天不怕地不惧，哼，愚蠢的人类，当然，喵星人的搞笑功力也是一流的！', '1', '999', '喵星人笑话_喵星人搞笑图片', '喵星人,喵星人搞笑图片,猫咪笑话,搞笑笔记', '猫咪是从遥远外太空来的，喵星人是来到地球的外星人，因为很萌的外表而获得人类的信任，成为少数与人类平等交往的朋友。他们天不怕地不惧，哼，愚蠢的人类，当然，喵星人的搞笑功力也是一流的！');
INSERT INTO `yi_tags` VALUES ('7', '汪星人', '/Uploads/tags/20160805/57a3f018e94ed.jpg', '人类忠实的朋友，可卖萌可霸气，能看家能毁家，在笔记里，我们重点讨论汪星人的二，某些汪星人无与伦比的二！', '1', '11', '汪星人_汪星人笑话', '汪星人搞笑图片,汪星人笑话,汪星人是什么意思,搞笑笔记', '人类忠实的朋友，可卖萌可霸气，能看家能毁家，在笔记里，我们重点讨论汪星人的二，某些汪星人无与伦比的二！\r\n');
