INSERT INTO `yi_tags` VALUES ('9', '冷笑话', '/Uploads/tags/55fbe027738d0.jpg', '冷笑话一般都超出常规的思维，不符合逻辑和生活实际，让人听了觉得一愣；虽然有些冷笑话挺好玩，但无论怎样，这种笑话听了也不会像那些听“正常”笑话后一样开怀大笑；', '1', '17', '冷笑话_冷笑话图片', '冷笑话,无聊笑话,冷段子,冷笑话图片,搞笑笔记', '冷笑话一般都超出常规的思维，不符合逻辑和生活实际，让人听了觉得一愣；虽然有些冷笑话挺好玩，但无论怎样，这种笑话听了也不会像那些听“正常”笑话后一样开怀大笑；');
