INSERT INTO `yi_tags` VALUES ('17', '恶搞', '/Uploads/tags/55fbdfbeb7e6a.jpg', '原意指出于恶意的搞笑，现在指在已有资源(如新闻图片、文艺作品)基础上进行再创作，原来的格调和气氛大变，包含各种搞笑元素，同时，新作和原作的对比往往能增强搞笑程度。', '1', '7', '恶搞笑话_恶作剧', '雷人恶搞,恶搞笑话,搞笑笔记', '原意指出于恶意的搞笑，现在指在已有资源(如新闻图片、文艺作品)基础上进行再创作，原来的格调和气氛大变，包含各种搞笑元素，同时，新作和原作的对比往往能增强搞笑程度。');
