INSERT INTO `yi_tags` VALUES ('20', '漫画', '/Uploads/tags/55fbe0417c50b.jpg', '漫画是一种艺术形式，是用简单而夸张的手法来描绘生活或时事的图画，有较强娱乐性，娱乐性质的作品往往存在搞笑型和人物创造型。', '1', '19', '漫画_搞笑漫画', '搞笑漫画,恶搞漫画,搞笑笔记', '漫画是一种艺术形式，是用简单而夸张的手法来描绘生活或时事的图画，有较强娱乐性，娱乐性质的作品往往存在搞笑型和人物创造型。');
