INSERT INTO `yi_tags` VALUES ('31', '逗比', '/Uploads/tags/55fbdfefd5ccd.jpg', '逗比是一个网络语言，根据合成词原则可以理解为:挺逗的二比。简单的说，就是说某个人很逗，有点犯二犯傻，有点可爱。随着它的使用范围逐步扩大，越来越多人将它用作中性词。但是在笔记的世界里，我们定义只是单纯的调侃和玩笑！', '1', '12', '逗比_逗比笑话', '逗比笑话,搞笑笔记', '逗比是一个网络语言，根据合成词原则可以理解为:挺逗的二比。简单的说，就是说某个人很逗，有点犯二犯傻，有点可爱。随着它的使用范围逐步扩大，越来越多人将它用作中性词。但是在笔记的世界里，我们定义只是单纯的调侃和玩笑！');
