INSERT INTO `yi_tags` VALUES ('36', '基友', '/Uploads/tags/5604a31eddd88.jpg', '基友的意思是男性之间亲密的朋友，在英文中，男同性恋的英文单词为“gay”，和粤语的“基”同音，因此就有了“搞基”、“基友”这种中文衍生一说，受不在娇,掰弯就行;攻不在深,给力就行。', '1', '99', '基友笑话_搞基_基友搞笑图片', '好基友,基友笑话,搞笑基友图片', '基友的意思是男性之间亲密的朋友，在英文中，男同性恋的英文单词为“gay”，和粤语的“基”同音，因此就有了“搞基”、“基友”这种中文衍生一说，受不在娇,掰弯就行;攻不在深,给力就行。');
