INSERT INTO `yi_user_joke` VALUES ('2', '有个二货舍友是怎样一种体验？', '', '&lt;p&gt;大学，我生病在校医院输液，舍友陪同。&lt;/p&gt;&lt;p&gt;液快输完了，护士一直不来。&lt;br/&gt;&lt;/p&gt;&lt;p&gt;舍友帮我喊：“护士快来啊，五床快完了”&lt;br/&gt;&lt;/p&gt;&lt;p&gt;我赶紧打住他“不是我完了，是药完了”&lt;br/&gt;&lt;/p&gt;&lt;p&gt;舍友：“护士快来啊，五床要完了”&lt;br/&gt;&lt;/p&gt;', '1', '100', '0', '1470283461', '1470283505', '1', '2', '1', '0', '19', '0', '0', '0', '5', '|31|33|', '1', '', '1');
INSERT INTO `yi_user_joke` VALUES ('3', '你们为什么总是吐槽老人呢？', '', '&lt;p&gt;为什么你们总是吐槽公交车上的老年人，什么老年卡，强占座位，不让位就数落。像我们这小城市多好，看到老年人多的站台，司机都不带停的！&amp;nbsp;&lt;/p&gt;', '0', '0', '0', '1470687339', '1470687350', '1', '2', '7', '0', '4', '0', '0', '0', '0', '|9|14|', '0', '', '0');
INSERT INTO `yi_user_joke` VALUES ('4', '我不厚道的笑出来了！', '', '&lt;p&gt;楼主闺蜜应邀参加一帅哥的生日派对。 她从晚上8点开始化妆、试衣服，一直捯饬到11点多才出门。 到了KTV，一推开门，一块蛋糕“啪”的砸脸上了！&lt;/p&gt;', '0', '0', '0', '1470687608', '1470688274', '1', '2', '7', '0', '4', '0', '0', '0', '0', '|18|49|', '0', '', '1');
