INSERT INTO `yi_user_joke` VALUES ('7', '那天，我哭得比任何一次战败都惨！', '', '&lt;p&gt;小时候，和我妈一言不合，就会招殴打。&lt;/p&gt;&lt;p&gt;一次被踹到了厨房。&lt;/p&gt;&lt;p&gt;我恶狠狠的说：“你再过来，我就还手了啊，别以为我打不过你！”&lt;/p&gt;&lt;p&gt;我妈冷笑到：“有本事你就把酱油瓶子举起来砸我呀！”&lt;/p&gt;&lt;p&gt;我二话不说，举起瓶子，准备威胁她。&lt;/p&gt;&lt;p&gt;结果酱油灌了我一脖子。&lt;/p&gt;&lt;p&gt;我妈：“哈哈哈哈，和我斗，那酱油瓶的盖子是松的，哈哈哈哈哈哈。”&lt;/p&gt;', '0', '0', '0', '1470760110', '1470762296', '1', '2', '9', '0', '7', '0', '0', '0', '0', '|19|26|44|', '0', '', '1');
