INSERT INTO `yi_user_joke` VALUES ('9', '为中国拳手吕斌遭裁判不公抱不平！', '', '&lt;p&gt;妈妈教傻儿子数数，教了很久儿子也没学会。&lt;br/&gt;妈妈伤心地说：“你不识数，长大以后什么工作也做不了。”&lt;br/&gt;弱智儿子傻笑着说：“我可以去奥运会当拳击裁判。”&lt;/p&gt;', '0', '0', '0', '1470804599', '1470807666', '1', '2', '1', '0', '4', '0', '0', '0', '0', '|25|', '0', '', '0');
INSERT INTO `yi_user_joke` VALUES ('10', '我觉得这种行为深深的伤害了我', '', '&lt;p&gt;晚上女朋友刚躺床上，我想跟她要点零花钱：亲爱的，商量个事呗，耽误你一分钟时间。女朋友听了立马脱了衣服，摆好了架势。&lt;/p&gt;&lt;p&gt;我觉得这种行为深深的伤害了我……&lt;/p&gt;', '0', '0', '0', '1470804915', '1470910467', '1', '2', '10', '0', '3', '0', '0', '0', '0', '|4|40|15|', '0', '', '1');
INSERT INTO `yi_user_joke` VALUES ('11', '然而姑娘还是木有付公交钱', '', '&lt;p&gt;有一天，坐公交车，上来一个姑娘，迷迷糊糊没睡醒的样子。&lt;br/&gt;她掏出一张一元纸钞，在公交卡感应区来回刷。&lt;br/&gt;车门那儿的人全笑了，司机边笑边提醒：“丫头，公交卡。”&lt;br/&gt;姑娘满脸通红，慌乱的从包里翻出公交卡，麻利的塞进了投币箱。&lt;/p&gt;', '0', '0', '0', '1470805741', '1470807673', '1', '2', '10', '0', '4', '0', '0', '0', '0', '|14|18|29|', '0', '', '1');
INSERT INTO `yi_user_joke` VALUES ('12', '我的字典里没有谦虚两个字！', '', '&lt;p&gt;小时候，我学习还算不错。那次考了全年级第一名。&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;晚上一个卖书画的叔叔来我家里做客，问我考试考得怎么样。&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;我说我考了全年级第一，我每次都是前十名。&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;叔叔笑道，小孩子要谦虚呦！&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;我太较真，恰好我又忘记谦虚这俩字怎么写了。&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;我走进里屋，拿出来一支笔和一张纸，径直走到叔叔身边说，谦虚这俩字咋写？&lt;/p&gt;', '1', '100', '7', '1470806212', '1470807678', '1', '2', '8', '0', '6', '0', '0', '0', '0', '|9|19|26|', '0', '', '1');
