INSERT INTO `yi_user_joke` VALUES ('22', '这剧情发展的不咋样啊！', '', '&lt;p&gt;大三的某个大雪纷飞的夜晚，&lt;br/&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;我拿着在超市买的大鸭梨排队结账。&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;满脑袋想的都是自习室的妹子。&lt;br/&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;突然发现前面的同学把水杯落在了收银台，我撒腿就追了出去。&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;烟台的雪真的好大，出门就模糊了视线，在茫茫同学中我无功而返。&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;回到了超市。&lt;br/&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;把水杯放回了收银台。&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;收银员一脸懵逼：“你拿我水杯干嘛？”&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;我....看到我手中的梨，接下来收银员说：“你去把我同事找回来，她喊着有人偷梨就追出去了！”&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', '0', '0', '0', '1470885962', '1470886142', '1', '2', '7', '0', '2', '0', '0', '0', '0', '|18|21|', '0', '', '0');
