INSERT INTO `yi_user_joke` VALUES ('24', '生活中夫妻的争吵，真的都是老公的错吗？', '', '&lt;p&gt;刚才媳妇发条链接给我，标题是：“生活中夫妻的争吵，真的都是老公的错吗？ 深度好文，不容错过”。 &lt;br/&gt;我一看好感动，终于理解男人不容易了，平时这么多争争吵吵其实也都是一些小事，&lt;br/&gt;虽然女人容易情绪化，有时候也很可爱嘛，而且家里照顾的也很好啊。&lt;br/&gt;思想波动了好久，点开链接，正文只有两个字：是的。。。&lt;/p&gt;', '0', '0', '0', '1470887473', '1470888526', '1', '2', '1', '1', '2', '0', '0', '0', '0', '|8|62|65|', '0', '', '0');
INSERT INTO `yi_user_joke` VALUES ('25', '这是我长这么大捡到的面值最大的钱了', '', '&lt;p&gt;今天和朋友在商场门口捡到50块钱。&lt;br/&gt;本着拾金不昧的精神的我去旁边的奶茶店要了两杯最贵的奶茶，&lt;br/&gt;我喝了一口感叹道：“这TM是我长这么大捡到的面值最大的钱了！”&lt;/p&gt;&lt;p&gt;朋友一脸不然的告诉我：“我小时候捡到过一张5000的，回家给我妈以后被打了半天！”&lt;/p&gt;', '0', '0', '0', '1470887807', '1470888532', '1', '2', '7', '0', '4', '0', '0', '0', '0', '|16|31|', '0', '', '1');
INSERT INTO `yi_user_joke` VALUES ('26', '这才是真正的神补刀啊！', '', '&lt;p&gt;男孩终于鼓起勇气问女孩：“你能做我的女朋友吗？”&lt;br/&gt;女孩说：“对不起，我已经有男朋友了。”&lt;br/&gt;男孩失落地转身离去，眼泪不住地往下流。&lt;br/&gt;走了不远，身后传来女孩急切的声音：“请等一下！”&lt;br/&gt;男孩破涕为笑，满怀期待地回头。 “就算没有男朋友，我也不会喜欢你的！”&lt;/p&gt;', '1', '50', '0', '1470887910', '1470910509', '1', '2', '7', '1', '9', '1', '0', '0', '0', '|27|34|', '0', '', '1');
