INSERT INTO `yi_user_joke` VALUES ('62', '人与人之间最基本的信任呢？', '', '&lt;p&gt;那天晚上，我走进个小巷子，忽然一个人拿把匕首抵在我的腰上，&lt;br/&gt;对我说：“大哥，兄弟我走投无路，麻烦借三百块钱。”&lt;br/&gt;我看看他体格，把钱包给了他，没想到他真的只拿了三百就还我，&lt;br/&gt;还留了我手机号，说有钱了就还我。&lt;br/&gt;过了几天，没想到他真打电话给我，约我去那个小巷。&lt;br/&gt;我一想钱虽然不多，但是不能让他以后内疚啊，我便去了。&lt;br/&gt;还是那把匕首，还是抵在我腰上，他对我说：“再借三百！”&lt;/p&gt;', '1', '50', '0', '1471058832', '1471060089', '1', '2', '24', '0', '4', '0', '0', '0', '0', '|18|65|', '0', '', '0');
