INSERT INTO `yi_user_joke` VALUES ('81', '现在卖行车记录仪的都这么拼吗？', '', '&lt;p style=&quot;margin: 0px; padding: 0px; font-size: 15px; font-weight: 400; font-family: STHeiti, &amp;#39;Microsoft yahei&amp;#39;, 微软雅黑, sans, tahoma; line-height: 25px; white-space: normal; background-color: rgb(255, 255, 255);&quot;&gt;车前有个小伙子，向后跳了一下摔倒在地，用很痛苦的表情看着我。&lt;br/&gt;我：“没撞到你啊，怎么年纪轻轻就讹人啊？”&lt;br/&gt;小伙子：“谁能证明，你有装行车记录仪吗？”&lt;br/&gt;我心头一紧，没装啊。&lt;br/&gt;“后悔了吧？” 说着小伙子从包里掏出了一个盒子，“大哥装一个吧，给你优惠价。”&lt;/p&gt;', '1', '100', '0', '1471143573', '1471143589', '1', '2', '24', '0', '4', '1', '0', '0', '5', '|14|43|', '0', '', '0');
