INSERT INTO `yi_user_joke` VALUES ('135', '这条笑话发自北京第三监狱！', '', '&lt;p&gt;学校有个校花很高冷，很多优秀青年都失败而归。&lt;br/&gt;我不信邪，准备试试，有天下了自习我拦住校花…&lt;br/&gt;我：“你觉得我人品如何？”校花：“很好…”&lt;br/&gt;我：“做我女朋友吧？”校花：“好”&lt;br/&gt;我：“你比较欣赏我哪一点？”&lt;br/&gt;校花：“哥，我都是你女朋友了，能把刀先放下吗？”&lt;/p&gt;', '0', '0', '0', '1471400271', '1471401596', '1', '2', '18', '0', '2', '0', '0', '0', '0', '|9|27|', '0', '', '0');
