INSERT INTO `yi_user_joke` VALUES ('138', '单身狗版《演员》', '', '&lt;p&gt;简单点，虐狗的方式简单点&lt;/p&gt;&lt;p&gt;递进的情绪请省略&lt;/p&gt;&lt;p&gt;你又不是饲养员&lt;/p&gt;&lt;p&gt;别设计虐狗情节&lt;/p&gt;&lt;p&gt;没意见我只想看看你怎么甜&lt;/p&gt;&lt;p&gt;你虐狗得太表面&lt;/p&gt;&lt;p&gt;像没天赋的初恋&lt;/p&gt;&lt;p&gt;单身狗一眼能看见&lt;/p&gt;&lt;p&gt;该配合你求婚的我演视而不见&lt;/p&gt;&lt;p&gt;在逼单身狗看秀恩爱即兴表演&lt;/p&gt;&lt;p&gt;什么时候我们开始收起了底线&lt;/p&gt;&lt;p&gt;顺应时代的改变看那些虐狗的表演&lt;/p&gt;&lt;p&gt;可我单身那么多年干嘛演出细节&lt;/p&gt;&lt;p&gt;我要送出多少祝福才能延缓厌倦&lt;/p&gt;&lt;p&gt;所以当我吃下狗粮后的这些那些&lt;/p&gt;&lt;p&gt;没意见你想怎么求我都随便&lt;/p&gt;&lt;p&gt;我狗粮也有限&lt;/p&gt;&lt;p&gt;又不用你出钱，虐狗请轻一些&lt;/p&gt;', '0', '0', '0', '1471453430', '1471453445', '1', '2', '18', '0', '5', '0', '0', '0', '0', '|17|22|32|', '0', '', '0');
