INSERT INTO `yi_user_joke` VALUES ('173', '差不多该换个手机了，顺便再换个女朋友！', '', '&lt;p&gt;&lt;/p&gt;&lt;p&gt;手机软件装多了，微信反应慢，&lt;br/&gt;睡前女友发微信：“想我了吗？”&lt;br/&gt;我赶紧打个想字，屏幕卡住了，&lt;br/&gt;女友又发：“你是不是想找个新女朋友？”&lt;br/&gt;我：“想。”&lt;br/&gt;女友：“你有没有想我的感受？”&lt;br/&gt;我回：“不敢想！”&lt;br/&gt;女友怒：“分手！！！”&lt;/p&gt;&lt;p&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', '1', '50', '0', '1471617436', '1471618611', '1', '2', '30', '0', '9', '1', '0', '0', '0', '|18|40|69|', '0', '', '0');
