INSERT INTO `yi_user_joke` VALUES ('176', '怎么？你还想还手？', '', '&lt;p&gt;&lt;/p&gt;&lt;p&gt;和媳妇吵架，媳妇很生气，抬起手就要搧我巴掌。&lt;br/&gt;而我则下意识地抓住了她的手，&lt;br/&gt;这下她更生气了:“怎么？你还想还手？”&lt;br/&gt;我忙陪着笑说：“哪能啊，我这不是怕自己皮糙肉厚，&lt;br/&gt;你搧我巴掌，会伤到自己的手么。”&lt;br/&gt;媳妇若有所思地点了点头，然后去厨房找了根擀面杖……&lt;/p&gt;&lt;p&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', '0', '0', '0', '1471617833', '1471618611', '1', '2', '19', '0', '8', '0', '0', '0', '0', '|18|44|61|', '0', '', '0');
