INSERT INTO `yi_user_joke` VALUES ('191', '当时我就懵逼了！', 'http://img.gaoxiaobiji.com/FijOUvN3TTuafl2frRzJSox9SwXv/w1', '&lt;p&gt;初中时学校搞大扫除，我们班分配的任务是除掉操场四周的草。&lt;br/&gt;第二天早上，当其他同学纷纷把镰刀拿出来的时候，坐在我后面的一哥们，转身从学校门口牵了五头牛进来，然后单手叉腰，豪气万千地指着操场上的草对面露茫然的牛说:&lt;br/&gt;去，快吃……&lt;br/&gt;当时全校师生和五头牛一起，集体懵逼——&lt;br/&gt;&lt;img src=&quot;http://img.gaoxiaobiji.com/FijOUvN3TTuafl2frRzJSox9SwXv&quot; alt=&quot;&quot; val=&quot;http://img.gaoxiaobiji.com/FijOUvN3TTuafl2frRzJSox9SwXv&quot;/&gt;&lt;/p&gt;', '1', '50', '0', '1471676860', '1471676870', '2', '2', '1', '0', '7', '0', '0', '0', '40', '|21|31|51|', '0', '', '0');
