INSERT INTO `yi_user_joke` VALUES ('287', '你和我老婆什么时候开始的', '', '&lt;p&gt;一同事用微信吊了一妹子，约好明天见面，谁知要去出差，就让我去见。&lt;br/&gt;我还挺高兴的，谁知到了宾馆见到那个女的，我就打电话给同事。&lt;br/&gt;那货以为我是感谢他，我默默说了一句“你和我老婆什么时候开始的……”&lt;/p&gt;', '1', '50', '0', '1472738571', '1472739297', '1', '2', '18', '0', '7', '1', '0', '0', '0', '|4|9|58|', '0', '', '0');
