INSERT INTO `yi_user_joke` VALUES ('290', '还是塑料蛇最有营养，你们不懂！', '', '&lt;p&gt;一朋友去年去泰国旅游买回来一大瓶蛇酒，里面泡有一条大眼镜蛇。每天坚持喝一点，还一直跟我炫耀说真有效，身子骨越来越好了，我感觉他也确实比以前精神，这一段至少年轻了好几岁。今天早上他碰到我说酒喝光了，他把眼镜蛇取出来了想煮汤吃，才发现蛇是塑料做的……&lt;/p&gt;', '0', '0', '0', '1472738976', '1472739714', '1', '2', '8', '0', '12', '1', '0', '0', '10', '|18|29|65|', '0', '', '1');
