INSERT INTO `yi_user_joke` VALUES ('459', '所以，怪我咯？', '', '&lt;p&gt;老爹喝酒归来，回家和老妈一顿吵，又干了一仗。&lt;br/&gt;我一看不行，赶紧劝架。左拉右拽的。&lt;br/&gt;老爸一脚踹来，“滚犊子，要不是你天天不学好，你爹也不至于天天喝酒。”，&lt;br/&gt;我正在发愣，突然老妈一个嘴巴子扇来，“臭小子，都是你，没你，&lt;br/&gt;老娘才不跟你爹这么多年。”&lt;/p&gt;', '0', '0', '0', '1473674936', '1473676253', '1', '2', '18', '0', '3', '0', '0', '0', '0', '|44|68|', '0', '', '0');
