INSERT INTO `yi_user_joke` VALUES ('577', '历史总是惊人的相似', '', '&lt;p&gt;刚考完驾照。教练问我:“看过西游记没？”&lt;br/&gt;我:“看过，怎么？”&lt;br/&gt;教练：“那还记得孙悟空下山时，菩提祖师怎么交代他的？”&lt;br/&gt;我：“菩提祖师让悟空不要在别人面前提起他是他师父。”&lt;br/&gt;教练点点头：“这也是我要跟你说的，你也不要跟别人说你是跟我学的车……”&lt;/p&gt;', '0', '0', '0', '1474725515', '1474725977', '1', '2', '20', '0', '3', '0', '0', '0', '0', '|9|', '0', '', '0');
