INSERT INTO `yi_user_joke` VALUES ('609', '我就是这么的热心肠！', '', '&lt;p&gt;早上路过一个算命摊，听见摆摊的跟一个小姑娘说：“姻缘并不难求，&lt;br/&gt;你只需花1000元问缘费，我便可助你找到白马王子。”&lt;br/&gt;我一听就知道是骗子，出于好心，&lt;br/&gt;我赶紧提醒小姑娘：“别听他的！你长这么丑，花多少钱都是嫁不出去的！”&lt;/p&gt;', '0', '0', '0', '1474938653', '1474940503', '1', '2', '33', '0', '4', '0', '0', '0', '0', '|9|29|', '0', '', '0');
