INSERT INTO `yi_user_joke` VALUES ('611', '论选对输入法的重要性', '', '&lt;p&gt;老大出差，忘带一份重要文件，发信息给我，让我想想办法。&lt;br/&gt;我回：不要着急，我给您快递过去。&lt;br/&gt;结果，粗心打出：不要找鸡…………&lt;br/&gt;看着信息无法撤回，我觉得脸皮掉了一地。&lt;br/&gt;半天，老大才回复：这也要你管啊？&lt;/p&gt;', '0', '0', '0', '1474939094', '1474940509', '1', '2', '6', '0', '5', '0', '0', '0', '0', '|18|69|', '0', '', '0');
INSERT INTO `yi_user_joke` VALUES ('612', '二货老婆欢乐多', '', '&lt;p&gt;和老婆一起去爬山。&lt;br/&gt;导游：你看到那水果了嘛？蜂蜜围着越多的越好吃！&lt;br/&gt;老婆指着一个围满蜜蜂的东西说：这个是不是最甜？&lt;br/&gt;导游：那是蜜蜂窝！&lt;/p&gt;', '0', '0', '0', '1474939229', '1474940512', '1', '2', '27', '0', '4', '0', '0', '0', '0', '|29|69|', '0', '', '0');
INSERT INTO `yi_user_joke` VALUES ('613', '这剧情真是跌宕起伏', '', '&lt;p&gt;昨晚喝多了，迷瞪的上床去了，扒拉扒拉媳妇衣服，&lt;br/&gt;隐约听见有人叫我姐夫，我一寻思这娘们还挺有情调。&lt;br/&gt;第二天，我看见小舅子在我身旁，我陷入了无限的沉思。&lt;/p&gt;', '0', '0', '0', '1474939318', '1474940517', '1', '2', '18', '0', '7', '0', '0', '0', '0', '|15|36|48|', '0', '', '0');
INSERT INTO `yi_user_joke` VALUES ('614', '真是个热心的吃瓜群众啊', '', '&lt;p&gt;火车上广播响起：“16号车厢一位旅客患有疾病，现寻求医护人员帮助。”&lt;br/&gt;话音刚落，坐我对面的大姐毅然决然的站起身：“小兄弟，&lt;br/&gt;帮我看下东西，我去看一下。”&lt;br/&gt;半小时后她回来了，我问：“您是医生还是护士？”&lt;br/&gt;大姐擦了擦汗：“我是看热闹的。”&lt;/p&gt;', '0', '0', '0', '1474939542', '1474940529', '1', '2', '18', '0', '6', '1', '0', '0', '0', '|18|33|', '0', '', '1');
INSERT INTO `yi_user_joke` VALUES ('615', '如何判断一个女人是不是真的爱你', '', '&lt;p style=&quot;margin: 0px; padding: 0px; font-size: 15px; font-weight: 400; font-family: STHeiti, &amp;#39;Microsoft yahei&amp;#39;, 微软雅黑, sans, tahoma; line-height: 25px; white-space: normal; background-color: rgb(255, 255, 255);&quot;&gt;判断一个女人是不是真的爱你，就在她发脾气的时候去强吻她。&lt;br/&gt;如果她挣脱开骂你神经病并变本加厉地发脾气，&lt;br/&gt;那么她可能并没有想象中的那么爱你，如果她挣扎一会就软在你身上，&lt;br/&gt;那么说明她很可能是窒息了。&lt;/p&gt;', '0', '0', '0', '1474939682', '1474940533', '1', '2', '18', '0', '9', '1', '0', '0', '0', '|9|', '0', '', '0');
