INSERT INTO `yi_user_joke` VALUES ('631', '这老婆真不错', '', '&lt;p&gt;半夜，老婆猛地坐了起来。我惊醒，急问：咋了？&lt;br/&gt;老婆喘着粗气：我刚梦见你掉河里了，吓死我了。&lt;br/&gt;我顿时有点小感动，心想，还是老婆关心我。于是接着问：然后呢？&lt;br/&gt;老婆一噘嘴：然后，我在岸上追着问你存折密码，&lt;br/&gt;你就是不说，把我给急醒了……&lt;/p&gt;', '0', '0', '0', '1475112227', '1475114368', '1', '2', '33', '0', '2', '0', '0', '0', '0', '|8|62|68|', '0', '', '0');
