INSERT INTO `yi_user_joke` VALUES ('639', '一个人可以有多无聊', '', '&lt;p&gt;今天正无聊到爆炸的时候，在厨房看到一只蚂蚁。&lt;br/&gt;我在它面前放了几块糖，它拿了一点以后就去叫它的朋友们了，&lt;br/&gt;说时迟那时快，我立马藏起了剩下的糖块。&lt;br/&gt;我要让它的队友们以为它是个大骗子。&lt;/p&gt;', '0', '0', '0', '1475113213', '1475114458', '1', '2', '31', '0', '5', '0', '0', '0', '0', '|17|23|29|', '0', '', '0');
INSERT INTO `yi_user_joke` VALUES ('640', '这套路太深了！', '', '&lt;p&gt;有一次没钱花了就在微博里说谁能借我点钱，这时一粉丝私我，&lt;br/&gt;叫我把卡号发给他，还真打了200块，我激动的叫他再打点。&lt;br/&gt;他说：“傻孩子，我是你爸，那有人给陌生人钱的！”&lt;br/&gt;这之后每天晚上我都和我爸聊天，半年后回到老家，&lt;br/&gt;我爸说他根本没微博，妈的200块，叫了那孙子半年爸 ！&lt;/p&gt;', '0', '0', '0', '1475113265', '1475114465', '1', '2', '11', '0', '4', '0', '0', '0', '0', '|47|62|65|', '0', '', '0');
INSERT INTO `yi_user_joke` VALUES ('641', '你这样是不好找男朋友的', '', '&lt;p&gt;前台妹纸是个刚毕业的应届生。&lt;br/&gt;老杨去前台复印文件，妹纸看了看老杨，&lt;br/&gt;怯怯的问到：“那个……杨叔，要几份？”&lt;br/&gt;老杨一脸微笑：“小蔡，有男朋友吗？”&lt;br/&gt;妹纸一脸迷茫：“没……没呢！”&lt;br/&gt;“你这样是不好找男朋友的，你太实诚了，你咬咬牙，喊句杨哥又能怎么了！”&lt;/p&gt;', '0', '0', '0', '1475113330', '1475114469', '1', '2', '19', '0', '3', '0', '0', '0', '0', '|18|', '0', '', '0');
INSERT INTO `yi_user_joke` VALUES ('642', '我都是以德服人的', '', '&lt;p&gt;打架被老师叫家长，我爸得知后立马风风火火赶到学校，&lt;br/&gt;二话不说就给我两巴掌冲我吼道：“暴力能解决问题吗？啊!？”&amp;nbsp;&lt;/p&gt;', '0', '0', '0', '1475113449', '1475114477', '1', '2', '33', '0', '3', '1', '0', '0', '10', '|18|65|', '0', '', '0');
INSERT INTO `yi_user_joke` VALUES ('643', '要放假了，曝光一种新型骗术请注意提高警惕', '', '&lt;p&gt;周末，老婆问：“亲爱的，如果有两个女的，一个年老一些的，&lt;br/&gt;一个年轻一些的，由你选一个带着去玩，你会选哪一个呢？”&lt;br/&gt;我问：“要我说真话，你不会生气？”老婆：“不会的。”&lt;br/&gt;我笑着说：“当然是选年轻一些的。”&lt;br/&gt;老婆笑着说：“好吧，女儿归你了，随便你带她去哪里玩都行，&lt;br/&gt;我就可去自己去逛街了。”我脸上的笑容立刻消失了……&lt;/p&gt;', '0', '0', '0', '1475113593', '1475114481', '1', '2', '31', '0', '4', '1', '0', '0', '0', '|8|62|65|', '0', '', '0');
