INSERT INTO `yi_user_joke` VALUES ('650', '记忆力有点不好～', '', '&lt;span style=&quot;color: rgb(36, 36, 36); font-family: \'Helvetica Neue\', Roboto, \'microsoft yahei\'; font-size: 14px; line-height: 24px; text-align: justify; background-color: rgb(250, 250, 250);&quot;&gt;正在上班，突然她给我打了一个电话。女：“老公，家里的钥匙放在哪儿了？”男：“不是一直放在门口的鞋柜上的吗？”女：“哎呀！老公，我的手机不见了！”男：“你不是正在和我通电话吗。”女：“哦~对不起啊，老公，我的记忆力不太好啊，打扰你工作了把？”男：“哦，没事，只是……我们两年前就已经离婚了……”&lt;/span&gt;', '0', '0', '0', '1475129781', '1475160016', '2', '2', '23', '0', '4', '0', '0', '0', '0', '|9|', '0', '', '0');
