INSERT INTO `yi_user_joke` VALUES ('674', '一车人已经开往地府的通道去了', '', '&lt;p&gt;&lt;/p&gt;&lt;p&gt;公交车上，因为是下班高峰期，一小伙说道：“挤什么挤，别挤了！&lt;br/&gt;我都过了好几个站了都下不了车！” &lt;br/&gt;另一小伙就说道：“大哥别说了，你比我好，我只是路过的都被挤上来了！”&lt;br/&gt;这时一四十多岁的大叔就说了：“都让让，都让让，让我过去，&lt;br/&gt;我是这公交车司机，现在是谁在开车啊？”&lt;/p&gt;', '0', '0', '0', '1475475414', '1475476083', '1', '2', '20', '0', '7', '3', '0', '0', '0', '|18|9|', '0', '', '0');
